    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Sullys Hill National Game Preserve for the next
    15 years. This plan outlines the Preserve vision and purpose and describes how Sullys
    Hill National Game Preserve will contribute to the overall mission of the Refuge
    System. The plan provides an introduction to the Preserve, a description of resources,
    and information on the management direction. Key planning issues include: staffing,
    visitor services, wildlife and habitat, and maintenance.",nt"license_title":
